const Home: React.FC = () => {
  const { canvasRef,lowerText,setLowerText,setUpperText,upperText } = useContext(Context)
  const [name] = useState({
    title: 'Meme Generator',
    description: 'Meme Generator or editing.'
  })
  return (
    <Container>
      <Head>
        <title>Meme Generator</title>
      </Head>
      <Title>{name.title}</Title>
      <Description>{name.description}</Description>
    </Container>
  )
}

export default Home
